import React from 'react';
import styled from 'styled-components';

const WheelContainer = styled.div`
  position: relative;
  width: 600px;
  height: 600px;
  margin: 0 auto;
`;

const WheelContent = styled.div`
  position: relative;
  width: 100%;
  height: 100%;
  display: flex;
  justify-content: center;
  align-items: center;
`;

const StarShape = styled.div`
  position: relative;
  width: 400px;
  height: 400px;
`;

const CenterContent = styled.div`
  position: absolute;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
  text-align: center;
  z-index: 3;
  width: 120px;

  svg {
    width: 40px;
    height: 40px;
    margin-bottom: 10px;
    fill: #e9a65b;
  }

  h3 {
    font-size: 14px;
    color: #333;
    margin: 0;
  }
`;

const TealSection = styled.div`
  position: absolute;
  width: 120px;
  height: 140px;
  background-color: #51817c;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  color: white;
  z-index: 2;

  svg {
    width: 30px;
    height: 30px;
    fill: white;
    margin-bottom: 8px;
  }

  .label {
    font-size: 12px;
    text-align: center;
    writing-mode: ${props => props.vertical ? 'vertical-rl' : 'horizontal-tb'};
    transform: ${props => props.vertical ? 'rotate(180deg)' : 'none'};
  }

  &.top {
    top: -70px;
    left: 50%;
    transform: translateX(-50%);
    clip-path: polygon(20% 0%, 80% 0%, 100% 100%, 0% 100%);
  }

  &.right {
    right: -70px;
    top: 50%;
    transform: translateY(-50%);
    clip-path: polygon(0% 20%, 100% 0%, 100% 100%, 0% 80%);
  }

  &.bottom {
    bottom: -70px;
    left: 50%;
    transform: translateX(-50%);
    clip-path: polygon(0% 0%, 100% 0%, 80% 100%, 20% 100%);
  }

  &.left {
    left: -70px;
    top: 50%;
    transform: translateY(-50%);
    clip-path: polygon(0% 0%, 100% 20%, 100% 80%, 0% 100%);
  }
`;

const ConnectingPart = styled.div`
  position: absolute;
  background-color: #e9a65b;
  z-index: 1;

  &.top-right {
    top: 15%;
    right: 15%;
    width: 120px;
    height: 30px;
    transform: rotate(45deg);
  }

  &.top-left {
    top: 15%;
    left: 15%;
    width: 120px;
    height: 30px;
    transform: rotate(-45deg);
  }

  &.bottom-right {
    bottom: 15%;
    right: 15%;
    width: 120px;
    height: 30px;
    transform: rotate(-45deg);
  }

  &.bottom-left {
    bottom: 15%;
    left: 15%;
    width: 120px;
    height: 30px;
    transform: rotate(45deg);
  }
`;

const ConnectingText = styled.div`
  position: absolute;
  color: #e9a65b;
  font-size: 12px;
  z-index: 2;

  &.policies {
    top: 25%;
    left: 10%;
    transform: rotate(-45deg);
  }

  &.conditions {
    top: 25%;
    right: 10%;
    transform: rotate(45deg);
  }

  &.risks {
    bottom: 25%;
    left: 10%;
    transform: rotate(45deg);
  }

  &.guardrails {
    bottom: 25%;
    right: 10%;
    transform: rotate(-45deg);
  }
`;

function FrameworkWheel({ onComponentSelect }) {
  return (
    <WheelContainer>
      <WheelContent>
        <StarShape>
          <ConnectingPart className="top-right" />
          <ConnectingPart className="top-left" />
          <ConnectingPart className="bottom-right" />
          <ConnectingPart className="bottom-left" />

          <TealSection className="top">
            <svg viewBox="0 0 24 24">
              <path d="M12 12c2.21 0 4-1.79 4-4s-1.79-4-4-4-4 1.79-4 4 1.79 4 4 4zm0 2c-2.67 0-8 1.34-8 4v2h16v-2c0-2.66-5.33-4-8-4z"/>
            </svg>
            <div className="label">Teams</div>
          </TealSection>

          <TealSection className="right" vertical>
            <svg viewBox="0 0 24 24">
              <path d="M3 13h8V3H3v10zM3 21h8v-6H3v6zM13 21h8V11h-8v10zM13 3v6h8V3h-8z"/>
            </svg>
            <div className="label">Resources</div>
          </TealSection>

          <TealSection className="bottom">
            <svg viewBox="0 0 24 24">
              <path d="M15.9 5c-.17 0-.32.09-.41.23l-.07.15-5.18 11.65c-.16.29-.26.61-.26.96 0 1.11.9 2.01 2.01 2.01.96 0 1.77-.68 1.96-1.59l.01-.03L16.4 5.5c0-.28-.22-.5-.5-.5zM1 9l2 2c2.88-2.88 6.79-4.08 10.53-3.62l1.19-2.68C9.89 3.84 4.74 5.27 1 9zm20 2l2-2c-1.64-1.64-3.55-2.82-5.59-3.57l-.53 2.82c1.5.62 2.9 1.53 4.12 2.75zm-4 4l2-2c-.8-.8-1.7-1.42-2.66-1.89l-.55 2.92c.42.27.83.59 1.21.97zM5 13l2 2c1.13-1.13 2.56-1.79 4.03-2l1.28-2.88c-2.63-.08-5.3.87-7.31 2.88z"/>
            </svg>
            <div className="label">Execution</div>
          </TealSection>

          <TealSection className="left" vertical>
            <svg viewBox="0 0 24 24">
              <path d="M19.43 12.98c.04-.32.07-.64.07-.98 0-.34-.03-.66-.07-.98l2.11-1.65c.19-.15.24-.42.12-.64l-2-3.46c-.09-.16-.26-.25-.44-.25-.06 0-.12.01-.17.03l-2.49 1c-.52-.4-1.08-.73-1.69-.98l-.38-2.65C14.46 2.18 14.25 2 14 2h-4c-.25 0-.46.18-.49.42l-.38 2.65c-.61.25-1.17.59-1.69.98l-2.49-1c-.06-.02-.12-.03-.18-.03-.17 0-.34.09-.43.25l-2 3.46c-.13.22-.07.49.12.64l2.11 1.65c-.04.32-.07.65-.07.98 0 .33.03.66.07.98l-2.11 1.65c-.19.15-.24.42-.12.64l2 3.46c.09.16.26.25.44.25.06 0 .12-.01.17-.03l2.49-1c.52.4 1.08.73 1.69.98l.38 2.65c.03.24.24.42.49.42h4c.25 0 .46-.18.49-.42l.38-2.65c.61-.25 1.17-.59 1.69-.98l2.49 1c.06.02.12.03.18.03.17 0 .34-.09.43-.25l2-3.46c.12-.22.07-.49-.12-.64l-2.11-1.65zm-1.98-1.71c.04.31.05.52.05.73 0 .21-.02.43-.05.73l-.14 1.13.89.7 1.08.84-.7 1.21-1.27-.51-1.04-.42-.9.68c-.43.32-.84.56-1.25.73l-1.06.43-.16 1.13-.2 1.35h-1.4l-.19-1.35-.16-1.13-1.06-.43c-.43-.18-.83-.41-1.23-.71l-.91-.7-1.06.43-1.27.51-.7-1.21 1.08-.84.89-.7-.14-1.13c-.03-.31-.05-.54-.05-.74s.02-.43.05-.73l.14-1.13-.89-.7-1.08-.84.7-1.21 1.27.51 1.04.42.9-.68c.43-.32.84-.56 1.25-.73l1.06-.43.16-1.13.2-1.35h1.39l.19 1.35.16 1.13 1.06.43c.43.18.83.41 1.23.71l.91.7 1.06-.43 1.27-.51.7 1.21-1.07.85-.89.7.14 1.13zM12 8c-2.21 0-4 1.79-4 4s1.79 4 4 4 4-1.79 4-4-1.79-4-4-4zm0 6c-1.1 0-2-.9-2-2s.9-2 2-2 2 .9 2 2-.9 2-2 2z"/>
            </svg>
            <div className="label">Actions</div>
          </TealSection>

